function sylvester_equation_solver(concat_sparse_vec::AbstractArray{‚Ñ±.Dual{Z,S,N}}; dims::Vector{Tuple{Int,Int}},tol::AbstractFloat = 1e-10) where {Z,S,N}
    # unpack: AoS -> SoA
    concat_sparse_vec_values = ‚Ñ±.value.(concat_sparse_vec)

    lenA = dims[1][1] * dims[1][2]
    lenB = dims[2][1] * dims[2][2]

    A = (reshape(concat_sparse_vec_values[1 : lenA],dims[1]))
    B = (reshape(concat_sparse_vec_values[lenA .+ (1 : lenB)],dims[2]))
    # X = sparse(reshape(concat_sparse_vec_values[lenA + lenB + 1 : end],dims[3]))


    # you can play with the dimension here, sometimes it makes sense to transpose
    ps = mapreduce(‚Ñ±.partials, hcat, concat_sparse_vec)'

    # get f(vs)
    val = sylvester_equation_solver(concat_sparse_vec_values, dims = dims)

    # get J(f, vs) * ps (cheating). Write your custom rule here
    b = ‚Ñ±.jacobian(x -> sylvester_equation_solver_conditions(x, val, dims = dims), concat_sparse_vec_values)
    a = ‚Ñ±.jacobian(x -> sylvester_equation_solver_conditions(concat_sparse_vec_values, x, dims = dims), val)
    # println(A)
    # println(size(A))
    # b = hcat(‚Ñí.kron(-x * B, ‚Ñí.I(size(A,1)))', ‚Ñí.kron(‚Ñí.I(size(B,1)), A * x), ‚Ñí.I(length(X)))
    # a = reshape(permutedims(reshape(‚Ñí.I - ‚Ñí.kron(A, B) ,size(B,1), size(A,1), size(A,1), size(B,1)), [2, 3, 4, 1]), size(A,1) * size(B,1), size(A,1) * size(B,1))

    AÃÇ = RF.lu(a, check = false)

    if !‚Ñí.issuccess(AÃÇ)
        AÃÇ = ‚Ñí.svd(a)
    end
    
    jvp = -(AÃÇ \ b) * ps

    # lm = LinearMap{Float64}(x -> A * reshape(x, size(B)), length(B))

    # jvp = - sparse(reshape(‚Ñê.gmres(lm, sparsevec(B)), size(B))) * ps
    # jvp *= -ps

    # pack: SoA -> AoS
    return reshape(map(val, eachrow(jvp)) do v, p
        ‚Ñ±.Dual{Z}(v, p...) # Z is the tag
    end,size(val))
end



